import React, { useState } from 'react';

import FormControl from '@material-ui/core/FormControl';
import FormControlLabel from '@material-ui/core/FormControlLabel';
import Button from '@material-ui/core/Button';
import TextField from '@material-ui/core/TextField';
import Radio from '@material-ui/core/Radio';
import RadioGroup from '@material-ui/core/RadioGroup';
import RadioButton from './RadioButton';
import { linkTypes } from '../enums/linkTypes.enum';

function EnterLink() {
	const [radioValue, setRadioValue] = useState('Video')

	return (
		<div>
			<FormControl>
				<TextField error requiredlabel="" helperText="Can't be empty" />


				<RadioButton name={linkTypes.VIDEO} />
				<RadioButton name={linkTypes.VIDEO} />

				<Button
					color="primary"
					variant="outlined">Submit
				</Button>
			</FormControl>

		</div>
	);
}

export default EnterLink;
